import React from 'react';
import styled from 'styled-components/native'

const Container = styled.View`
  background-color: red;
`

const Title = styled.Text`
  font-size: 20px;
`


const App = () => {
return (
  <Container>
    <Title>Hej</Title>
  </Container>
)

}

export default App;
